import React from 'react'
import styles from './navigation.module.css'
import NavButton from './nav-button'
import * as ICON from '../components/icons'
// import {MENU} from '../components/DATA/MENU'

const MENU = [
    {
        key:'twitter',
        logo: <ICON.Twitter />,
        path: '/',
        text: '',

    },
    {
        key:'Home',
        logo: <ICON.Home />,
        path: '/',
        text: 'Home',

    },
    
    {
        key:'Explore',
        logo: <ICON.Explore/>,
        path: '/Explore',
        text: 'Explore',

    },
    {
        key:'Notification',
        logo: <ICON.Notification/>,
        path: '/Notification',
        text: 'Notification',

    },
    {
        key:'Messages',
        logo: <ICON.Messages/>,
        path: '/Messages',
        text: 'Messages',

    },
    {
        key:'Bookmark',
        logo: <ICON.Bookmark/>,
        path: '/Bookmark',
        text: 'Bookmark',

    },
    {
        key:'Lists',
        logo: <ICON.Lists/>,
        path: '/Lists',
        text: 'Lists',

    },
    {
        key:'Profile',
        logo: <ICON.Profile/>,
        path: '/Profile',
        text: 'Profile',

    },
    {
        key:'More',
        logo: <ICON.More/>,
        path: '/More',
        text: 'More',

    },
]

function Navigation({flat=false,children,text,icon}) {

    
    return (
        <nav>
            {/* <NavButton  selected=""><Icons.ArrowBottom /><span>Bookmark</span></NavButton> */}
            {
                MENU.map((item)=> {
                    <NavButton key={item.key}>
                    {item.text}
                    </NavButton>
                    console.log(item)
                })
            }
            
        </nav>
    )
}


export default Navigation
